import React from 'react';
import styled from 'styled-components';

const NavContainer = styled.ul`
    background-color: #55f;
    width: 300px;
    height: 100%;
    & > li {
        border: 1px solid #eee;
    }
`;

const AdminNav = () => {
    return (
        <NavContainer>
            <li></li>
        </NavContainer>
    );
};

export default AdminNav;
